package soundsource.springframework.soundsourcebackend.controllers;

import org.springframework.web.bind.annotation.GetMapping;
import org.springframework.web.bind.annotation.RequestMapping;
import org.springframework.web.bind.annotation.RestController;
import com.wrapper.spotify.exceptions.SpotifyWebApiException;
import com.wrapper.spotify.model_objects.specification.Playlist;
import com.wrapper.spotify.requests.data.playlists.CreatePlaylistRequest;
import com.wrapper.spotify.requests.data.playlists.UploadCustomPlaylistCoverImageRequest;

import org.apache.hc.core5.http.ParseException;

import java.io.IOException;

import static soundsource.springframework.soundsourcebackend.controllers.AuthenticationController.spotifyApi;

@RestController
@RequestMapping("/api")
public class CreatePlaylistController {

    @GetMapping(value = "createPlaylist")
    public static String createPlaylist() {
        final String userId = UserController.getUserId();
        final String name = "SoundSource Top 100";

        final CreatePlaylistRequest createPlaylistRequest = spotifyApi.createPlaylist(userId, name).build();

        try {
            final Playlist playlist = createPlaylistRequest.execute();

            uploadCustomPlaylistCoverImage(playlist.getId());

            System.out.println("Name: " + playlist.getName());
            return playlist.getId();
        } catch (IOException | SpotifyWebApiException | ParseException e) {
            System.out.println("Error: " + e.getMessage());
            return "ERROR";
        }
    }

    public static void uploadCustomPlaylistCoverImage(String playlistId) {

        final UploadCustomPlaylistCoverImageRequest uploadCustomPlaylistCoverImageRequest = spotifyApi
                .uploadCustomPlaylistCoverImage(playlistId)
                .image_data("")
                .build();

        try {
            final String string = uploadCustomPlaylistCoverImageRequest.execute();

            System.out.println("Null: " + string);
        } catch (IOException | SpotifyWebApiException | ParseException e) {
            System.out.println("Error F: " + e.getMessage());
        }
    }
}
